import React from 'react';
import styled from 'styled-components';
import { BlotterText } from './BlotterText';

const AboutSection = styled.section`
  min-height: 100vh;
  padding: 4rem 2rem;
  display: flex;
  flex-direction: column;
  justify-content: center;
`;

const Content = styled.div`
  max-width: 1200px;
  margin: 0 auto;
  text-align: center;
`;

const Text = styled.p`
  font-size: 1.5rem;
  line-height: 1.6;
  margin: 2rem 0;
  color: #f0f0f0;
  font-family: 'Comic Sans MS', cursive;
`;

export const About: React.FC = () => {
  return (
    <AboutSection>
      <Content>
        <BlotterText 
          text="ABOUT SQUANCHCOIN" 
          size={60}
          fill="#ffffff"
        />
        <Text>
          Hey there, squanchers! *burp* Let me tell you about the most squanchy token in the multiverse - SquanchCoin!
        </Text>
        <Text>
          I'm tellin' ya, this isn't just some regular schmeckle-grabbing scheme. This is a community-driven token that's all about bringing squanchers together! We're talking about a token that's as secure as my secret squanching spot!
        </Text>
        <Text>
          And let me tell you something about our tokenomics - it's so squanching beautiful, it'll make your eyeholes water! With anti-whale mechanics and automatic liquidity generation, we're keeping this ecosystem healthier than my great-grandma's squanch recipe!
        </Text>
      </Content>
    </AboutSection>
  );
};
